import React from 'react';
import './Sidebar.css';
import { media } from '../../media/media';


const Sidebar = () => {
  return (
      <div className="sidebar">
          <div className="top">
              <i class="fa-light fa-bars"></i>
              <div className="logo">
                  <img src={media.logo} alt="logo" />
                  <h1>perplexity</h1>
              </div>
              <div className="new-chat"></div>
          </div>
          <div className="bottom"></div>
      </div>
  );
};


export default Sidebar
